import React, { Component } from "react";
import PropTypes from "prop-types";
import {
  Button,
  Header,
  Icon,
  Menu,
  Segment,
  Container,
  Dropdown,
  Sidebar
} from "semantic-ui-react";
import firebase from "../FirebaseAPI";

export class RevCode extends Component {
  render() {
    return (
      <div>
        <Menu fixed="top" inverted>
          <Container>
            <Menu.Item as="a" header>
              <Icon name="code" style={{ marginRight: "1em" }} />
              RevCode
            </Menu.Item>
          </Container>
        </Menu>
        <Segment.Group horizontal>
          <Segment>
            <Sidebar as={Menu} direction="left" inverted vertical visible>
              <Menu.Item as="a" header>
                File Permissions
              </Menu.Item>
              <Menu.Item as="a">Share on Social</Menu.Item>
              <Menu.Item as="a">Share by E-mail</Menu.Item>
              <Menu.Item as="a">Edit Permissions</Menu.Item>
              <Menu.Item as="a">Delete Permanently</Menu.Item>
            </Sidebar>
          </Segment>
          <Segment>Middle</Segment>
          <Segment>Right</Segment>
        </Segment.Group>
      </div>
    );
  }
}

export default RevCode;

